class InformationModel {  int? status;  String? message;  Data? data;  InformationModel({this.status, this.message, this.data});  InformationModel.fromJson(Map<String, dynamic> json) {    status = json['status'];    message = json['message'];    data = json['data'] != null ? new Data.fromJson(json['data']) : null;  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['status'] = this.status;    data['message'] = this.message;    if (this.data != null) {      data['data'] = this.data!.toJson();    }    return data;  }}class Data {  String? weight;  String? sugarPercentage;  String? fatPercentage;  Data({this.weight, this.sugarPercentage, this.fatPercentage});  Data.fromJson(Map<String, dynamic> json) {    weight = json['weight'];    sugarPercentage = json['sugar_percentage'];    fatPercentage = json['fat_percentage'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['weight'] = this.weight;    data['sugar_percentage'] = this.sugarPercentage;    data['fat_percentage'] = this.fatPercentage;    return data;  }}